<div id="ensdeconv" class="section level1">
<h1>EnsDeconv</h1>
<p>EnsDeconv (Ensemble Deconvolution) which uses ensemble learning to to robustly estimate cellular fractions from bulk omics data.</p>
<div id="installation" class="section level2">
<h2>Installation</h2>
<pre><code>devtools::install_github(&quot;randel/EnsDeconv&quot;)</code></pre>
